function getClassicTheme(){
var theme_classic = {
    "left" : "data:image/png;base64,",
    "right" : "data:image/png;base64,",
    "lupa" : "data:image/png;base64,"
};

    return theme_classic;
}


$( document ).ready(function() {
    var theme_classic = getClassicTheme();

    $('.fast_search_prev').css('background','url(' + theme_classic['left'] + ')');
    $('.fast_search_next').css('background','url(' + theme_classic['right'] + ')');
    $('.fast_search_result').css('background','#fff').css('border','2px solid #000').css('border-radius','17px');
    $('#searchbox_id').css('border','2px solid #000').css('background','url(' + theme_classic['lupa'] + ')no-repeat')
        .css('background-position-y','2px').css('background-position-x','98%');

    // minimization of search form
    chrome.storage.sync.get('fast_search_minimal_style', function(a) {
        var x = a['fast_search_minimal_style'];
        if(x){
            minimize_search_form();
            return false;
        }
        else
        {
            maximize_search_form();
            return false;
        }
    });

    //minimize_search_form();
});

function maximize_search_form()
{
    $('.fast_search_result').removeClass('mini');
}


function minimize_search_form()
{
    $('.fast_search_result').addClass('mini');
}
